function changeActiveNav(){var e=document.getElementsByClassName("nav-link");0===document.getElementsByClassName("activeNav").length&&document.querySelector(".nav-link").classList.add("activeNav");for(let t=0;t<e.length;t++)e[t].addEventListener("click",(function(){let a=document.getElementsByClassName("activeNav");for(let e=0;e<a.length;e++)a[e].classList.remove("activeNav");e[t].classList.add("activeNav")}))}